import React, { useEffect, useState } from "react";
import UnitDisplay from "../components/UnitDisplay";
import axios from "axios";
import api from "../highOrder/axios";

export default function Explore() {
  const [units, getUnits] = useState({ units: [] });

  useEffect(() => {
    const getAllUnits = async () => {
      try {
        const response = await api.get("unitlisting/");
        getUnits(response.data);
        console.log(units);
      } catch (err) {
        //Not in the 200 response range then
        if (err.response) {
          console.log(err.response.data.message);
          console.log(err.response.status);
          console.log(err.response.headers);
        } else {
          console.log(`Error: ${err.message}`);
        }
      }
    };
    getAllUnits();
  }, []);

  return (
    <>
      <h1>my Component has Mounted, Check the browser 'console' </h1>
      {units.count && units.map((unit) => <li>{JSON.stringify(unit)}</li>)}
    </>
  );
}
